import Box from "@mui/material/Box";
import Paper from '@mui/material/Paper';
import Typography from '@mui/material/Typography';
function ResultantArray({array,updatedArray,selectedActivity,sho}) {
  if (!showResultantArray) {
    return null;
  }
  return (
    <>
      <Box sx={{margin:'2rem 0'}}>
        <Paper elevation={0} sx={{padding:'1rem'}}>
          <Typography 
          sx={{color:'#1565c0',
          letterSpacing:'2px',
          fontWeight:'bold'}}
          >
          1.Your Array : <span style={{color:'green',letterSpacing:'3px',}}>{JSON.stringify(array) }</span>

          </Typography>

        <Typography
         sx={{color:'#1565c0',
         letterSpacing:'2px',
         fontWeight:'bold'}}
        >
            2.Selected activity: <span style={{color:"green",letterSpacing:'3px',}}>{`${selectedActivity && selectedActivity.label}`}</span>
        </Typography>
        <Typography
         sx={{color:'#1565c0',
         letterSpacing:'2px',
         fontWeight:'bold'}}
        >
            3.Method Description: <span style={{color:"green",letterSpacing:'3px',}}>{`${selectedActivity && selectedActivity.function} 

            }}`}</span>
        </Typography>
        <Typography
         sx={{color:'#1565c0',
         letterSpacing:'2px',
         fontWeight:'bold'}}
        >
            4.Resultant array after applying {selectedActivity && selectedActivity.label} Method: - <span style={{color:'green',letterSpacing:'3px',}}>{JSON.stringify(updatedArray)}</span>

        </Typography>
        </Paper>


      </Box>
    </>
  );
}
export default ResultantArray;
